import React from 'react';



function Change() {

    let img = {};
    let curDate = new Date();
    curDate = curDate.getHours();



    if (curDate >= 1 && curDate < 12) {

        img= "https://thecinemaholic.com/wp-content/uploads/2020/01/sabrina-15.jpg"

    } else if (curDate >= 12 && curDate < 19) {

        img = "https://m.media-amazon.com/images/I/81v-UM1XSBL._SS500_.jpg";
    } else {

        img = "https://pbs.twimg.com/media/Ct_jw7LXgAAit_k.jpg";
    }


    return (

        <React.Fragment>
            <img src={img}/>
        </React.Fragment>
        
        
        );

}

export default Change;
